const eventType = $json.eventType;
const eventData = $json.eventData;
const timestamp = $json.timestamp;
const userId = eventData.userId || 'unknown';

let message = `Healthcare Event Received:\n`;
message += `Event Type: ${eventType}\n`;
message += `Timestamp: ${timestamp}\n`;
message += `User ID: ${userId}\n`;
message += `\nEvent Details:\n`;

// Format event data based on event type
switch(eventType) {
  case 'patient_search':
    message += `- Specialty: ${eventData.searchParams?.specialty || 'N/A'}\n`;
    message += `- Hospital: ${eventData.searchParams?.hospital || 'N/A'}\n`;
    break;
  case 'cost_estimate':
    message += `- Patient Age: ${eventData.estimateData?.patientAge || 'N/A'}\n`;
    message += `- Insurance: ${eventData.estimateData?.insuranceType || 'N/A'}\n`;
    message += `- Department: ${eventData.estimateData?.department || 'N/A'}\n`;
    message += `- Procedure: ${eventData.estimateData?.procedure || 'N/A'}\n`;
    break;
  case 'doctor_rating':
    message += `- Doctor: ${eventData.ratingData?.doctorName || 'N/A'}\n`;
    message += `- Specialty: ${eventData.ratingData?.specialty || 'N/A'}\n`;
    message += `- Rating: ${eventData.ratingData?.rating || 'N/A'}\n`;
    message += `- Hospital: ${eventData.ratingData?.hospital || 'N/A'}\n`;
    break;
  case 'analytics_view':
    message += `- View Type: ${eventData.analyticsData?.viewType || 'N/A'}\n`;
    message += `- Year: ${eventData.analyticsData?.filters?.year || 'N/A'}\n`;
    message += `- Hospital Filter: ${eventData.analyticsData?.filters?.hospital || 'N/A'}\n`;
    break;
  default:
    message += JSON.stringify(eventData, null, 2);
}

// Add to output
return [{
  json: {
    eventType: eventType,
    message: message,
    timestamp: timestamp,
    userId: userId,
    rawData: $json
  }
}];
